// Footer.js
import React from "react";

const Footer = () => {
  return (
    <footer style={{
      backgroundColor: "#333", 
      color: "white", 
      padding: "10px", 
      textAlign: "center",
      position: "fixed",
      bottom: "0", 
      width: "100%"
    }}>
      <p>&copy; {new Date().getFullYear()} My E-Commerce Website</p>
      <p>Made with ❤️ by Your Name</p>
    </footer>
  );
};

export default Footer;
